(142, 1, '2022-11-07 13:33:07', '2022-11-07 13:33:07', '<!-- wp:gallery {\"linkTo\":\"none\"} -->\n<figure class=\"wp-block-gallery has-nested-images columns-default is-cropped\"><!-- wp:image {\"id\":156,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/wordpress/wp-content/uploads/2022/11/Sobre-nosotros-1-1024x672.jpeg\" alt=\"\" class=\"wp-image-156\"/></figure>\n<!-- /wp:image --></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Sobre el servicio</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Nuestra plataforma te permite publicar tus ideas de proyectos  y recibir ofertas de servicio por parte de personas registradas en la plataforma. Somos un equipo comprometido con la seguridad en el registro de usuarios para brindarte facilidad de búsqueda y confiabilidad.<br><br>Aquí le damos prioridad a tu idea o necesidad de recurso humano profesional.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Nuestro equipo</h5>\n<!-- /wp:heading -->\n\n<!-- wp:media-text {\"mediaPosition\":\"right\",\"mediaId\":174,\"mediaLink\":\"http://localhost/wordpress/sobre-nodostros/caracteristicas_de_un_ingeniero_de_sistemas_urepublicacanaradio_emisora_radio_universitaria_estudiar_bogota_colombia_imag1-1/\",\"mediaType\":\"image\",\"mediaWidth\":35,\"mediaSizeSlug\":\"thumbnail\",\"imageFill\":true} -->\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile is-image-fill\" style=\"grid-template-columns:auto 35%\"><figure class=\"wp-block-media-text__media\" style=\"background-image:url(http://localhost/wordpress/wp-content/uploads/2022/11/Caracteristicas_de_un_Ingeniero_de_sistemas_URepublicacanaRadio_emisora_radio_universitaria_estudiar_bogota_colombia_imag1-1-150x150.jpg);background-position:50% 50%\"><img src=\"http://localhost/wordpress/wp-content/uploads/2022/11/Caracteristicas_de_un_Ingeniero_de_sistemas_URepublicacanaR