(183, 1, '2022-11-12 04:08:38', '2022-11-12 04:08:38', '<div class=\"\">\n<h3 class=\"dark-color lblname\"><img class=\"alignnone size-medium wp-image-186\" src=\"http://localhost/wordpress/wp-content/uploads/2022/11/portrait-happy-young-woman-looking-camera_23-2147892777-300x300.webp\" alt=\"\" width=\"300\" height=\"300\" />Beatriz Gonzalez</h3>\n<h6 class=\"theme-color lead lblprofesiones\">Contador público</h6>\n<b>Perfil profesional</b>\n\nContador Público Especialista en Pensión en Panamá | Ruta pensional | Rentas vitalicias |Proyección de Jubilación | Portafolios de Jubilación en Pesos y Dólares | Consultora Patrimonial | Planeación Patrimonial Socios | Transición Patrimonial.\n\n<b>Habilidades</b>\n\nInteresada en crear y favorecer oportunidades, para que mis clientes aseguren, en su jubilación, su pensión de retiro, su independencia financiera y su calidad de vida.\n<div class=\"row about-list mb-4\">\n<div class=\"col-md-12\">\n<div class=\"media\">\n<div class=\"media\">\n\n<label>Ciudad:</label>Santiago De Cali\n\n</div>\n<div class=\"media\">\n\nJuanCeballos@CPA.com\n\n</div>\n<div class=\"media\">\n\n<label>Dirección</label>Calle 27 NORTE #6N 46\n\n</div>\n</div>\n</div>\n</div>\n</div>', 'Juan Ceballos', '', 'inherit', 'closed', 'closed', '', '182-autosave-v1', '', '', '2022-11-12 04:08:38', '2022-11-12 04:08:38', '', 182, 'http://localhost/wordpress/?p=183', 0, 'revision', '', 0),
